import React from "react";
import "./NewsletterEmailsStyle.css";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEdit } from "@fortawesome/free-solid-svg-icons";

const NewsletterEmailsList = ({ emails }) => {
  return (
    <>
      <h2 className="emails_list_title">Моите категории</h2>
      <table className="email">
        <thead>
          <tr>
            <th>Id</th>
            <th>Title</th>
            <th>Options</th>
          </tr>
        </thead>
        <tbody>
          {emails.map((email, index) => {
            return (
              <tr style={{ fontSize: 20, padding: 15 }} key={index}>
                <td> {email.id}</td>
                <td>{email.email}</td>
                <td>
                  <Link to={`/my_profile/email/${email.id}`}>
                    <FontAwesomeIcon className="edit" icon={faEdit} />{" "}
                  </Link>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </>
  );
};

export default NewsletterEmailsList;
